--- grid
local grid = {}
local cellSize = 51

local score = 0
local won = false
local over = false
local keepPlaying = false

local height = platform.window:height() --212
local width = platform.window:width() 	--318

--- animation stuff
local movingDirection = 0
local animationLength = 2 --- moves x times between moves
local animationStep = 0
local isMoving = false
local speed = 60


function on.construction()
	resetGrid()
	if not var.list()[1] then
		var.store("best", 0)
	end
end

-- width: 318    height: 212
--- draw screen
function on.paint(gc)
	gc:setColorRGB(251, 248, 239)
	gc:fillRect(0, 0, width, height)

	gc:drawImage(board, 53, 0)

	-- draw them normally
	if not isMoving then
		eachCell(function (x, y, tile)
			if tile then
				gc:drawImage(getImage(tile.value), 59 + ((x - 1) * cellSize), 6 + ((y - 1) * cellSize))
			end
		end)
	else -- animations
		eachCell(function (x, y, tile)
			if tile and tile.oldSelf then
				for i = 1, table.getn(tile.oldSelf) do
					local t = toSingleTable(tile.oldSelf[i])
					local vect = getVector(movingDirection)
					local dist = getDistance(tile, t)
					local ex = vect.x * ((animationStep / animationLength) * dist)
					local why = vect.y * ((animationStep / animationLength) * dist)
					gc:drawImage(getImage(t.value), ((t.x - 1) * cellSize) + ex + 59, ((t.y - 1) * cellSize) + why + 6)
				end
			end
		end)
	end

	-- other
	gc:setColorRGB(0, 0, 0)
	gc:setFont("sansserif", "r", 8)
	gc:drawString("v 1.2", 0, height)
	gc:drawImage(title, 4, 54)
	gc:drawImage(newGame, 1, 1)
	gc:drawImage(bestPic, 301, 144)
	gc:drawImage(scorePic, 301, 32)
	drawNum(score, 282, 52, gc)
	drawNum(var.recall("best"), 282, 158, gc)
	if over then
		gc:drawImage(gameOver, 68, 89)
		gc:drawImage(enterToRestart, 87, 185)
	end
	if won then
		gc:drawImage(youWin, 92, 89)
		gc:drawImage(enterToContinue, 79, 185)
	end
end

function getDistance(tile1, tile2)
	local ex = math.abs(tile1.x - tile2.x) * cellSize
	local why = math.abs(tile1.y - tile2.y) * cellSize
	return math.max(ex, why)
end

function toSingleTable(tabl)
	if table.getn(tabl) == 1 then
		return tabl[1]
	else
		return tabl
	end
end

function drawNum(num, x, y, gc) -- centered on x, y
	local str = num .. ""
	local h = 0
	for i = 1, str:len() do -- get the size / height
		h = h + getNum(str:sub(i, i)):height() + 2
	end
	local pos = y - (h / 2)
	for i = 1, str:len() do -- draw it
		local img = getNum(str:sub(i, i))
		gc:drawImage(img, x - (img:width() / 2), pos)
		pos = pos + img:height() + 2
	end
end

function on.timer()
	animationStep = animationStep + 1
	if animationStep > animationLength then
		animationStep = 0
		isMoving = false
		timer.stop()
	end
	platform.window:invalidate()
end

function on.arrowKey(key)
	if not isMoving then
		if key == "up" 		then move(1) end
		if key == "right" 	then move(2) end
		if key == "down" 	then move(3) end
		if key == "left" 	then move(4) end
	end
end

function on.charIn(ch)
	if not isMoving then
		if ch == "8" 		then move(1) end
		if ch == "6" 		then move(2) end
		if ch == "2" 		then move(3) end
		if ch == "4" 		then move(4) end
	end
end


function on.mouseDown(x, y)
	local mouseVect = physics.Vect(x, y)
	if physics.BB(1, 1, 51, 22):containsVect(mouseVect) then
		resetGrid()
	end
end

function on.mouseMove(x, y)
	local mouseVect = physics.Vect(x, y)
	if physics.BB(1, 1, 51, 22):containsVect(mouseVect) then
		cursor.set("hand pointer")
	else
		cursor.set("default")
	end
end

function on.enterKey()
	if won then
		won = false
		platform.window:invalidate()
	end
	if over then
		resetGrid()
	end
end

function on.clearKey()
	resetGrid()
	var.store("best", 0)
end

function resetGrid()
	for ex = 1, 4 do
		grid[ex] = {}
		for why = 1, 4 do
			grid[ex][why] = nil
		end
	end
	won = false
	over = false
	score = 0
	addStartTiles()
	platform.window:invalidate()
end

---------------------------------------------------
--- Move tiles on the grid in the specified direction
function move(direction)
	-- 1: up, 2: right, 3: down, 4: left
	movingDirection = direction

	if isGameTerminated() then
		return
	end

	local cell, tile

	local vector 	 =	getVector(direction)
	local traversals = 	buildTraversals(vector)
	local moved      = 	false

	--  Save the current tile positions and remove merger information
	prepareTiles()

	-- Traverse the grid in the right direction and move tiles
	for keyx, ex in pairs(traversals.x) do
		for keyy, why in pairs(traversals.y) do
			cell = { x = ex, y = why }
			tile = cellContent(cell)

			if (tile) then

				local positions = findFarthestPosition(cell, vector)
				local nex      =  cellContent(positions.nex)

				if (nex and nex.value == tile.value and not nex.mergedFrom) then
					local merged = newTile(positions.nex, tile.value * 2)
					merged.mergedFrom = {tile, nex }

					-- basically, if the tile it is merging into has already moved, then it adds tile position to oldSlef
					if nex.oldSelf then
						merged.oldSelf  = {
							nex.oldSelf,
							newTile({x = tile.x, y = tile.y}, tile.value)
						}
					-- if it has not moved, then set its oldSelf to both its current position and tile's position
					else
						merged.oldSelf = {
							newTile({x = tile.x, y = tile.y}, tile.value),
							newTile({x = nex.y, y = nex.y}, tile.value)
						}
					end

					insertTile(merged)
					removeTile(tile)

					-- Converge the two tiles' positions

					updatePosition(tile, positions.nex)

					-- Update the score
					score = score + merged.value
					if score > var.recall("best") then
						var.store("best", score)
					end

					-- The mighty 2048 tile
					if (merged.value == 2048) then won = true end
				else
					moveTile(tile, positions.farthest)
				end
				if (not positionsEqual(cell, tile)) then
					moved = true -- The tile moved from its original cell!
				end
			end
		end
	end

	if (moved) then
		addRandomTile()
	end
	if (not movesAvailable()) then
		over = true --Game over!
	end

	timer.start(1 / speed)
	isMoving = true

	platform.window:invalidate()
end

function newTile(position, val)
	return {
		x = position.x,
		y = position.y,
		value = val,
		previousPosition = nil,
		mergedFrom = nil,
		oldSelf = nil
	}
end

function getVector(direction)
	-- Vectors representing tile movement
	local map = {
		{ x = 0,  y = -1 }, -- Up
		{ x = 1,  y = 0 },  -- Right
		{ x = 0,  y = 1 },  -- Down
		{ x = -1, y = 0 }   -- Left
	}

	return map[direction]
end

function addStartTiles()
	for i = 1, 2 do
		addRandomTile()
	end
end

function addRandomTile()
	if cellsAvailable() then
		local value = math.random() < 0.9 and 2 or 4
		local tile = newTile(randomAvailableCell(), value)

		insertTile(tile)
	end
end

function cellsAvailable()
	return table.getn(availableCells()) > 0
end

function availableCells()
	local cells = {}
	eachCell(function (x, y, tile)
		if not tile then
			table.insert(cells, { x = x, y = y })
		end
	end)
	return cells
end

function eachCell(callback)
	for x = 1, 4 do
		for y = 1, 4 do
			callback(x, y, grid[x][y])
		end
	end
end

function randomAvailableCell()
	local cells = availableCells()

	if (table.getn(cells)) then
		return cells[math.random(1, table.getn(cells))]
	end
end

function insertTile(tile)
	grid[tile.x][tile.y] = tile
end

function removeTile(tile)
	grid[tile.x][tile.y] = nil
end

function isGameTerminated()
	if over or (won and not keepPlaying) then
		return true
	else
		return false
	end
end

function buildTraversals(vector)
	local traversals = { x = {}, y = {}}

	for pos = 1, 4 do
		table.insert(traversals.x, pos)
		table.insert(traversals.y, pos)
	end

	-- Always traverse from the farthest cell in the chosen direction
	if (vector.x == 1) then traversals.x = reverse(traversals.x) end
	if (vector.y == 1) then traversals.y = reverse(traversals.y) end

	return traversals
end

function prepareTiles()
	eachCell(function (x, y, tile)
	if (tile) then
		tile.mergedFrom = nil
		tile.oldSelf = nil
		savePosition(tile)
	end
	end)
end

function savePosition(tile)
	tile.previousPosition = { x = tile.x, y = tile.y }
end

function cellContent(cell)
	if (withinBounds(cell)) then
		return grid[cell.x][cell.y]
	 else
		return nil
	end
end

function withinBounds(position)
	return position.x > 0 and position.x <= 4 and position.y > 0 and position.y <= 4
end

function findFarthestPosition(cel, vector)
	local prev
	-- Progress towards the vector direction until an obstacle is found
	prev = cel;
	cel     = { x = prev.x + vector.x, y = prev.y + vector.y };

	while (withinBounds(cel) and cellAvailable(cel)) do
		prev = cel;
		cel     = { x = prev.x + vector.x, y = prev.y + vector.y };
	end
	return {
		farthest = prev,
		nex = cel -- Used to check if a merge is required
	}
end

function cellAvailable(cell)
	return not cellOccupied(cell)
end

function cellOccupied(cell)
	return not not cellContent(cell)
end

function updatePosition(tile, position)
	tile.x = position.x
	tile.y = position.y
end

function moveTile(tile, cell)


	grid[tile.x][tile.y] = nil
	grid[cell.x][cell.y] = tile

	tile.oldSelf = {newTile({x = tile.x, y = tile.y}, tile.value)}
	--print(table.tostring(tile.oldSelf))
	updatePosition(tile, cell)
end

function positionsEqual(first, second)
	return first.x == second.x and first.y == second.y
end

function movesAvailable()
	return cellsAvailable() or tileMatchesAvailable()
end

function tileMatchesAvailable()
	local tile

	for x = 1, 4 do
		for y = 1, 4 do
			tile = cellContent({ x = x, y = y })

			if (tile) then
				for direction = 1, 4 do
					local vector = getVector(direction)
					local cell   = { x = x + vector.x, y = y + vector.y }

					local other  = cellContent(cell)

					if (other and other.value == tile.value) then
						return true -- These two tiles can be merged
					end
				end
			end
		end
	end
	return false
end
